import React from 'react';
import { Link } from 'react-router-dom';
import webBackground from '../imgs/'

function Home() {
    return(
        <div>
            <div>
                <nav>
                    <h1>Dogger</h1>
                    <Link to='/login'>Log In</Link>
                </nav>
            </div>
            <div>
                <img src='../imgs/BigWebHomeImg.jpg'/>
                <h1>Paw Right</h1>
                <Link to='/signup'>Create Account</Link> 
            </div>
        </div>
        
    );
}

export default Home;
